assert header_sort_url('name', ['name', 'age'], max_sorted_fields=2
    ) == '/?sort=-name&sort=age'
assert header_sort_url('age', ['name', 'age'], max_sorted_fields=2
    ) == '/?sort=-age&sort=name'
